import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


const AppList = () => {
  return (
    <h1> Hello</h1>
  );
}

const App = () => {
  return (
    <>
    <h1> Helvetica </h1>
    <AppList/>
    </>
    );
}

ReactDOM.render(
  <App/>,
  document.getElementById('root')
);
